import { userInfoType } from "../types"

const ADD_Register = "ADD_Register"

interface defaultStateType{
    user: userInfoType
}

const defaultState = {
    user: {}
}

export const registerReducer = (state=defaultState, action):defaultStateType => {
    switch (action.type) {
        case ADD_Register:
            return {...state, 
                use: action.payload}
        default: 
            return state
    }
}
